import React from "react";
import { Link } from "react-router-dom";

const Menu = () =>{
    return(
        <>
        <div className="header">
        <ul>
            <li><Link to='/'>About </Link></li>
            <li><Link to='/1'>About </Link></li>
            <li><Link to='/2'>About </Link></li>
            </ul>
        </div>
        </>
    );
};
export default Menu;
